import React, { Component } from 'react';
import qrcode from '../statics/images/qrcode4.png';

class Main extends Component{

 render()
 {
    return(
        <div className="container">
            <div className="row">
                <div className="col-6">
                    <img src={ qrcode } alt="Qr Code" className="img-thumbnail w-100"/>
                </div>
                <div className="col-6">

                </div>
            </div>
        </div>
    )
 }
}
export default Main;
